import React, { useContext } from 'react';
import appContext from './context/app-context';

const Panel = () => {
	const { title} = useContext(appContext);
	console.log(useContext(appContext));
	return (
		<>
			<h1>{title}</h1>
			<button>Zamknij</button>
		</>
	);
};

export default Panel;
